import React, { useEffect } from 'react';

const DetailPage = () => {
    const goHome = () => {
        history.push('/');
      };

      useEffect(() => {
        console.log(history);
        const unblock = history.block('정말 떠나실건가요?');
        return () => {
          unblock();
        };
      }, [history]);


  return (
    <div>
      <h1>상세 정보</h1>
    </div>
  );
};

export default DetailPage;
